import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UserListComponent } from '../app/user-list-component.component';
import { AdjustBalanceComponent } from '../app/adjust-balance-component.component';
import { TransactionHistoryComponent } from '../app/transaction-history-component.component';

const routes: Routes = [
  { path: 'user-list', component: UserListComponent },
  { path: 'adjust-balance', component: AdjustBalanceComponent },
  { path: 'transaction-history', component: TransactionHistoryComponent },
  // Add more routes as needed
  { path: '', redirectTo: '/user-list', pathMatch: 'full' },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
